function [x2dot]=RightLeg(x,th,ths,time,kpid)

% my dynamic calculation symbolic program th5 (Yaw), th6 (Pitch), th7 (Pitch), th8 (Pitch), th5 (Yaw)
% my original Ditch Program                            th5 (Yaw), th6 (Pitch), th7 (Pitch), th16 (Pitch), th5 (Yaw)
% Ravi sir original Flat Program                        th6 (Yaw). th7 (Pitch), th8 (Pitch), th6 (Pitch), th5 (Yaw)
% I am replacing, th8 (Pitch, my dynamic calculation symbolic program) with th16 (Pitch in my original Ditch Program)
% and using the properties of th6 (Pitch, in Ravi Sir original Flat Program) in and as th16

cth5=th(41:48);
cth6=th(49:56);
cth7=th(57:64);
cth16=th(65:72);
cth8=th(73:80);

th5s=ths(1);
th6s=ths(2);
th7s=ths(3);
th16s=ths(4);
th8s=ths(5);

global l5; global l6; global l7; global l16; global l8;
global m5; global m6; global m7; global m16; global m8;

t25=[0 0 0 0 0 0 0 0];
t26=[0 0 0 0 0 0 0 0];
t27=[0 0 0 0 0 0 0 0];
t216=[0 0 0 0 0 0 0 0];
t28=[0 0 0 0 0 0 0 0];

for p=1:8

  th16=cth16(p);
  t216(p)=th16;

  th8=(pi/2)-cth8(p);
  t28(p)=th8;

  th7=(pi/2)-cth7(p);
  t27(p)=th7;

  th6=cth7(p)-cth6(p);
  t26(p)=th6;

  th5=(pi/2)-cth5(p);
  t25(p)=th5;
  
  [comega5, calpha5]=differential(t25,time);
  [comega6, calpha6]=differential(t26,time);
  [comega7, calpha7]=differential(t27,time);
  [comega16, calpha16]=differential(t216,time);
  [comega8, calpha8]=differential(t28,time);
  
  omega1(5)=-comega5(p);
  alpha1(5)=-calpha5(p);
  
  omega1(6)=comega7(p)-comega6(p);
  alpha1(6)=calpha7(p)-calpha6(p);

  omega1(7)=-comega7(p);
  alpha1(7)=-calpha7(p);
  
  omega1(8)=-comega8(p);
  alpha1(8)=-calpha8(p);
  
  omega1(16)=comega16(p);
  alpha1(16)=calpha16(p);
  
end

%% Step-1
% Making Configuration Diagram in home position, assigning the frames, determining the T34-H parameters for each links
% and then identifying the basic transformation matrix 0T1, 1T2, 2T3, 3T4, 4T5

%% Step-2
% Computation of Transformation Matrix 0T5
% Initial Transformation Matrix T01 = 0T1, T12 = 1T2, T23 = 2T3, T34 = 3T4, T45 = 4T5

T01 = [cos(th5) 0 sin(th5) l5*cos(th5);sin(th5) 0 -cos(th5) l5*sin(th5);0 1 0 0;0 0 0 1];
T12 = [cos(th6) -sin(th6) 0 l6*cos(th6);sin(th6) cos(th6) 0 l6*sin(th6);0 0 1 0;0 0 0 1];
T23 = [cos(th7) -sin(th7) 0 l7*cos(th7);sin(th7) cos(th7) 0 l7*sin(th7);0 0 1 0;0 0 0 1];
T34 = [cos(th16) 0 -sin(th16) l16*cos(th16);sin(th16) 0 cos(th16) l16*sin(th16);0 -1 0 0;0 0 0 1];
T45 = [cos(th8) -sin(th8) 0 l8*cos(th8);sin(th8) cos(th8) 0 l8*sin(th8);0 0 1 0;0 0 0 1];

% Other Transformation Matrix
% T00 = 0T0 = 1T1 = 2T2 = 3T3 = 4T4 = 5T5
% eye command is for identity matrix of (n,m) order

T00 = eye(4,4);

% T01 = 0T1, T02 = 0T2, T03 = 0T3, T04 = 0T4, T05 = 0T5, T13 = 1T3, T14 = 1T4, T24 = 2T4 

T02 = T01*T12;
T03 = T01*T12*T23;
T04 = T01*T12*T23*T34;
T05 = T01*T12*T23*T34*T45;
T13 = T12*T23;
T14 = T12*T23*T34;
T15 = T12*T23*T34*T45;
T24 = T23*T34;
T25 = T23*T34*T45;
T35 = T34*T45;

% T21 = inv(T12); T31 = inv(T13); T32 = inv(T23); T41 = inv(T14); T42 = inv(T24);
% T43 = inv(T34); T51 = inv(T15); T52 = inv(T25); T53 = inv(T35); T54 = inv(T45);

%% Step-3
% Joint Variables Q terms, since all are the revolute joint, having the same value

