d312=[cos(conj(th6))*sin(conj(th5))*sin(conj(th7)) + cos(conj(th7))*sin(conj(th5))*sin(conj(th6)), cos(conj(th6))*cos(conj(th7))*sin(conj(th5)) - sin(conj(th5))*sin(conj(th6))*sin(conj(th7)), 0,   sin(conj(th5))*sin(conj(th6))*conj(l6) + cos(conj(th6))*sin(conj(th5))*sin(conj(th7))*conj(l7) + cos(conj(th7))*sin(conj(th5))*sin(conj(th6))*conj(l7);- cos(conj(th5))*cos(conj(th6))*sin(conj(th7)) - cos(conj(th5))*cos(conj(th7))*sin(conj(th6)), cos(conj(th5))*sin(conj(th6))*sin(conj(th7)) - cos(conj(th5))*cos(conj(th6))*cos(conj(th7)), 0, - cos(conj(th5))*sin(conj(th6))*conj(l6) - cos(conj(th5))*cos(conj(th6))*sin(conj(th7))*conj(l7) - cos(conj(th5))*cos(conj(th7))*sin(conj(th6))*conj(l7);0,0,0,0;0,0,0,0];
